import react from 'react';
import {NavLink} from 'react-router-dom'

const MyData = ()=>{
    return (
        <>
        <div className="row">
           <div className="col-12 col-md-12 text-center">
        <h1 >Search your user name</h1><NavLink activeClassName="" to="myData"><span className="float-right">visit user</span></NavLink>
        </div>
        </div>
    </> 
   )
}

export default MyData
